import React, { useState, useCallback } from 'react';
import { Form, List, Button} from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 50%;
    margin : 0 auto;
    margin-top: 20px;
`;

const CustomBtn = styled(Button)`
    width: auto;
    float: right;
`;

const data = [{
    id: 1,
    content: '돈 500만원 모으기',
}, {
    id: 2,
    content: '살 70Kg 만들기'
}];

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <List
                style={{overflow: 'hidden'}}
                size="small"
                bordered
                dataSource={data}
                renderItem={item => <List.Item>{item.content}<CustomBtn danger>삭제</CustomBtn></List.Item>}
                />
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
